import React from "react";
import Card from "./Card/Card";
import Full from "./Full/Full";
import card from '../../json/housing.json'
import './Logement.css'

export default function Logement({type, data}){


    return (
        <div>
            {type === 'card' ? 
              <Card key={card.id} id={card.id} title={card.title} description={card.description} cover={card.cover}/>
            : <Full data={data}/> 
            }
        </div>
    );
}
